import { FormLabel, Select } from "@chakra-ui/react"

const YearInput = () => {
    const current_year = (new Date()).getFullYear();
    const year: number[] = []

    for (let y = current_year; y >= 2014; y--) {
        year.push(y)
    }
    console.log(current_year);
    console.log(year);

    return (
        <>
            <FormLabel>西暦</FormLabel>
            {year.map((year, index) => (
                <Select>
                    <option>{year}</option>
                </Select>
            ))}
        </>
    )
}

export default YearInput
